import React from "react";
import './Project.css';

function Project({id, title, description, user_id}){
    return (
        <div className="Project">
            <p className="Project__title">
                <h1>{title}</h1>
            </p>
            <p className="Project__userid">
                owner : {user_id}
            </p>

            <p className="Project__description">
                {description}
            </p>
        </div>
    )
}

export default Project;
